from typing import List
import heapq

class Solution:
    def maxScore(self, nums1: List[int], nums2: List[int], k: int) -> int:
        # Sort pair(nums1[i], nums2[i]) by nums2[i] in descending order
        pairs = [(x,y) for x, y in zip(nums1, nums2)]
        pairs = sorted(pairs, key=lambda x: -x[1])

        # Use a min-heap to maintain the top k elements
        top_k_heap = [x[0] for x in pairs[:k]]
        heapq.heapify(top_k_heap)
        top_k_sum = sum(top_k_heap)

        # The score of the first k pairs
        res = top_k_sum * pairs[k-1][1]
        print(f'\tres = {res}')

        # Iterate from k to last index of pairs
        for i in range(k, len(pairs)):
            # Pop the smallest element from heap. Push the current element from nums1.
            # Update res if needed.
            n = heapq.heappop(top_k_heap)
            top_k_sum -= n
            heapq.heappush(top_k_heap, pairs[i][0])
            top_k_sum += pairs[i][0]
            print(f'\t\ttop_k_heap, nums2i = {top_k_heap}, {pairs[i][1]}')
            res = max(res, top_k_sum*pairs[i][1])
        return res

